import React from 'react';

import './UserItem.css';

const attachment = {
  name: props.attachmentName,
  format: props.attachmentFormat,
  path: props.attachmentPath,
}
const VisitComplaintItem = props => (
  <li key={props.userId} className="users__list-item">
    <div>
      <p>
        Date: {props.date}
      </p>
      <p>
        Title: {props.title}
      </p>
      <p>
        Description: {props.description}
      </p>
      <p>
        Anamnesis: {props.anamnesis}
      </p>
      <p>
        Attachment:
      </p>
      <p>
        Name: {props.attachmentName}
      </p>
      <p>
        Format: {props.attachmentFormat}
      </p>
      <p>
        Path: {props.attachmentPath}
      </p>
    </div>
    <Button variant="info" onClick={props.onViewAttachment.bind(this, )}>
      View
    </Button>
  </li>
);

export default VisitComplaintItem;
